import React from 'react';
import ABCLogo from './Images/ABCLogo.png'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={ABCLogo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
